import React,{Component} from 'react';
import {Header , Icon, List} from 'semantic-ui-react';
import axios from 'axios';

class App extends Component {
  state = {
    AdresaF: []
  }
  componentDidMount(){
    axios.get('https://localhost:5001/api/AdresaFaturimit').then((response) => {
    this.setState({
        AdresaF: response.data
    })
    })
  }
  render(){
    return (
      <div>
       <Header as='h2'>
         <Icon name='book'/>
         <Header.Content>LabProjekt</Header.Content>
       </Header>
       <List>
         {this.state.AdresaF.map((adresa : any) => (
           <List.Item key={adresa.id}>{adresa.emri}</List.Item>
         ))}
       </List>
      </div>
    );
  }

}

export default App;
